module.exports = "<ion-header class=\"\">\n  <ion-toolbar class=\"light-bg\">\n    <ion-buttons slot=\"start\" class=\"menu-button\">\n      <ion-menu-button menu=\"main-menu\" class=\"purple\"></ion-menu-button>\n    </ion-buttons>    \n    <ion-buttons slot=\"end\" class=\"menu-container\">\n      <button class=\"menu-items\" [routerLink]=\"['/home']\">\n        Inicio\n      </button>\n      <button class=\"menu-items\" [routerLink]=\"['/report']\">\n        Denunciar\n      </button>\n      <button class=\"menu-items current\" [routerLink]=\"['/about']\">\n        ¿Quienes somos?\n      </button>    \n      <button class=\"menu-items\" [routerLink]=\"['/login']\">\n        Ingresar\n      </button>\n    </ion-buttons>\n    <ion-title>      \n      <a href=\"/home\"><img src=\"../assets/img/logo.png\" id=\"logo\" alt=\"Asociación progreso para México\"></a>                        \n    </ion-title>\n  </ion-toolbar>\n</ion-header>\n\n<ion-content>\n  <h1 class=\"title green-title\" align=\"center\">Asociación de Progreso para México</h1>\n  <article>\n    <div class=\"cards\">\n      <h3 class=\"green-title\">¿Quienes somos?</h3>\n      <p align=\"justify\">Somos un equipo multidisciplinario, multicultural; siendo conformada \n      mayoritariamente por mujeres, jóvenes de diversas disciplinas de las\n      áreas sociales; con una amplia experiencia en el trabajo de capacitación, \n      gestión, desarrollo y ejecución de proyectos dentro del ámbito público y \n      social.</p>\n\n      <h3 class=\"green-title\">Objeto social</h3>\n\n      <p align=\"justify\">Atención y apoyo a personas que se vean impedidas para satisfacer sus \n      necesidades básicas de subsistencia tales como alimentación, vestido, \n      salud, educación, cultura y capacitación, que necesiten apoyo \n      psicosocial, físico y emocional, que no cuenten con los elementos \n      necesarios para su desarrollo integral y social, a través de mejorar y \n      modificar las circunstancias que impidan al individuo su desarrollo, \n      otorgando servicios que mejoren las condiciones psicosociales, \n      educativas, de salud física, emocional, de autosuficiencia, \n      sustentabilidad, cultura y de orientación social.</p>\n\n      <h2 class=\"purple\">Nuestros Objetivos</h2>\n\n      <div class=\"card-obj centralized\">\n        <ion-card>\n          <img src=\"../assets/img/participacion.png\" width=\"100%\" height=\"250px\"/>\n          <ion-card-header>          \n            <ion-card-title>Participación Ciudadana</ion-card-title>\n          </ion-card-header>\n          <ion-card-content>\n            <p>Promover la participación ciudadana con la finalidad de construir una sociedad justa, igualitaria y sustentable.</p>\n          </ion-card-content>\n        </ion-card>\n      </div>      \n      \n      <div class=\"card-obj\">\n        <ion-card>\n          <img src=\"../assets/img/promocion-derechos.jpg\" width=\"100%\" height=\"250px\"/>\n          <ion-card-header>          \n            <ion-card-title>Promoción de los derechos</ion-card-title>\n          </ion-card-header>\n          <ion-card-content>\n            <p>Desarrollar acciones bajo una perspectiva de derechos, equidad, igualdad, seguridad social, cultura, artes, educación ambiental.</p>\n          </ion-card-content>\n        </ion-card>      \n      </div>      \n\n      <div class=\"card-obj\">\n        <ion-card>\n          <img src=\"../assets/img/capacitacion.jpg\" width=\"100%\" height=\"250px\"/>\n          <ion-card-header>          \n            <ion-card-title>Capacitación</ion-card-title>\n          </ion-card-header>\n          <ion-card-content>\n            <p>Diseñar, implementar, gestionar y coordinar programas de intervención, capacitación, producción artística y cultural.</p>\n          </ion-card-content>\n        </ion-card>      \n      </div>      \n\n      <div class=\"card-obj centralized\">\n        <ion-card>\n          <img src=\"../assets/img/intervencion.jpg\" width=\"100%\" height=\"250px\"/>\n          <ion-card-header>          \n            <ion-card-title>Intervención Social</ion-card-title>\n          </ion-card-header>\n          <ion-card-content>\n            <p>Elaborar propuestas de intervención social, desarrollo sustentable, igualdad de género, política social y de derechos.</p>\n          </ion-card-content>\n        </ion-card>      \n      </div>      \n\n      <div class=\"card-obj\">\n        <ion-card>\n          <img src=\"../assets/img/desarrollo.jpg\" width=\"100%\" height=\"250px\"/>\n          <ion-card-header>          \n            <ion-card-title>Desarrollo Social</ion-card-title>\n          </ion-card-header>\n          <ion-card-content>\n            <p>Realizar acciones que favorezcan el desarrollo social, medio ambiental y la paz con un enfoque de respeto.</p>\n          </ion-card-content>\n        </ion-card>      \n      </div>      \n\n      <div class=\"card-obj\">\n        <ion-card>\n          <img src=\"../assets/img/grupos.jpg\" width=\"100%\" height=\"250px\"/>\n          <ion-card-header>          \n            <ion-card-title>Grupos Prioritarios</ion-card-title>\n          </ion-card-header>\n          <ion-card-content>\n            <p>Promoción, defensa, formación, organización y capacitación para el cumplimiento de los derechos de grupos prioritarios.</p>\n          </ion-card-content>\n        </ion-card>      \n      </div>      \n\n      <div class=\"card-obj last-row\">\n        <ion-card>\n          <img src=\"../assets/img/identidad.jpg\" width=\"100%\" height=\"250px\"/>\n          <ion-card-header>          \n            <ion-card-title>Fortalecimiento a la Identidad</ion-card-title>\n          </ion-card-header>\n          <ion-card-content>\n            <p>Implementar acciones que promuevan y fortalezcan el idioma, la identidad, costumbres, organización en un ambiente de respeto a los derechos civiles.</p>\n          </ion-card-content>\n        </ion-card>      \n      </div>      \n\n      <div class=\"card-obj\">\n        <ion-card>\n          <img src=\"../assets/img/balance.jpg\" width=\"100%\" height=\"250px\"/>\n          <ion-card-header>          \n            <ion-card-title>Equidad Social</ion-card-title>\n          </ion-card-header>\n          <ion-card-content>\n            <p>Impulsar trabajos organizativos, productivos y educativos con mujeres, promoviendo acciones que tiendan al alcance de una mayor equidad social.</p>\n          </ion-card-content>\n        </ion-card>      \n      </div>      \n    </div>      \n  </article>\n\n  <article>\n    <div class=\"cards\">\n      <h1 class=\"purple\">¿Qué hacemos?</h1>\n      <h2>Servicios:</h2>\n      <h3 class=\"green-title\">Proyectos</h3>\n      <p align=\"justify\">Desarrollamos programas y proyectos acordes a las necesidades de las instituciones; desde la planeación, ejecución y seguimiento; creando estrategias para medir su impacto y resultados obtenidos.</p>\n      <h3 class=\"green-title\">Investigación:</h3>\n      <p align=\"justify\">Servicios de consultoría estratégica, asistencia técnica, investigación social especializada en políticas y programas públicos de actuación. Logrando incluir los sectores involucrados para la búsqueda de soluciones.</p>\n      <h3 class=\"green-title\">Gestión:</h3>\n      <p align=\"justify\">Asesoría en procuración de fondos y gestión de diversos tipos de proyectos; cabildeo y construcción de alianzas participativas, brindando acompañamiento y propuestas para alcanzarlo.</p>\n      <h3 class=\"green-title\">Capacitación:</h3>\n      <p align=\"justify\">Diseño e impartición de talleres acorde a la problemática, población objetivo y necesidades; con indicadores que permiten evaluar alcances; cuantificar logros y propuestas para su actualización constante.</p>    \n    </div>    \n  </article>\n  \n  <article>\n    <div class=\"cards\">\n      <h2 class=\"purple\">Áreas de trabajo:</h2>\n      <ul>\n        <li>Equidad de genero</li>\n        <li>Política y Gobierno</li>\n        <li>Participación Social</li>\n        <li>Prevención Social</li>\n      </ul>\n    </div>    \n  </article>\n\n  <ion-footer>\n    <div class=\"footer\">\n      <div class=\"footer-content\">\n        <h4 class=\"green-title\">Contacto</h4>      \n        <ion-item lines=\"none\" class=\"footer-item\">\n          <ion-icon name=\"call-outline\"></ion-icon>\n          <p>311 264 0466</p>\n        </ion-item>        \n        <ion-item lines=\"none\" class=\"footer-item\">\n          <ion-icon name=\"logo-facebook\"></ion-icon>\n          <p>/promexac</p>\n        </ion-item>        \n        <ion-item lines=\"none\" class=\"footer-item\">\n          <ion-icon name=\"mail-outline\"></ion-icon>\n          <p>contacto@progresoparamexico.org</p>        \n        </ion-item>\n      </div>      \n    </div>    \n  </ion-footer>\n</ion-content>\n";

